import React from 'react'

export const Sign_img = () => {
  return (
    <>
    <div className="right_data mt-6 col-lg-5" style={{width:"100%"}}>
            <div className="sign_img mt-2 col-lg-5">
              <img src="./signup_image.jpeg" style={{maxWidth:420, borderRadius:50}} alt=""/>
            </div>
          </div>
    </>
  )
}
